import React,{Component} from 'react'
import { HeaderWrapper,Logo ,Nav,NavItem} from './style.js'
export default class Header extends Component{
    render(){
        return <HeaderWrapper>
            <Logo href="/"></Logo>
            <Nav>
                <NavItem></NavItem>
            </Nav>
            </HeaderWrapper>
    }
}
